using System;
using MeetU.Lib;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace BackEnd.Tests.Lib
{
    [TestClass]
    public class TestDataUri
    {
        //
        //  Test for PNG, 30kb, 50-60 ms
        //
        [TestMethod]
        public void TestForPNG()
        {
            var png = "data:image/png;base64,";
            var dataUri = new DataUri(png);
            var dataExpected = "";

            Assert.AreEqual(dataExpected, dataUri.Data);
            Assert.AreEqual("image/png", dataUri.Mime);
            Assert.AreEqual("base64", dataUri.Encoding);
            Assert.AreEqual("png", dataUri.Format);
            Assert.IsTrue(dataUri.IsSupported);            
        }
    }
}
